"""
这是7个月前没有做出来的老题（当时好蠢呀！！！），其实很简单的动态规划题目，转移方程为当if i == 0 or j == 0时dp[i][j] = 1，其它情况下
dp[i][j] = dp[i-1][j-1] + 1。就是这样做，虽然时间和空间复杂度都是平方级别的。
"""
class Solution:
    def findLength(self, A, B) -> int:
        m = len(A)
        n = len(B)
        dp = [[0] * m for i in range(n)]
        ret = 0
        for i in range(m):
            for j in range(n):
                if A[i] == B[j]:
                    if i == 0 or j == 0:
                        dp[i][j] = 1
                    else:
                        dp[i][j] = dp[i-1][j-1] + 1
                    if dp[i][j] > ret:
                        ret = dp[i][j]
        print(dp[1])
        return ret


